    IF NEW.type = 'local' AND NEW.program_dataset IS NULL THEN
        SET NEW.program_dataset = 'GfDOw2s4mCj';
    END IF;

    -- Set default start_date for 'dhis2' type to the current date
    IF NEW.type = 'dhis2' AND NEW.start_date IS NULL THEN
