INSERT INTO `default_text` (`id`, `key_name`, `translations`, `created`, `updated`) VALUES
(1, 'select_language', '{\"en\": \"Select Language\", \"lg\": \"Yingira Olulimi\", \"rn\": \"Hitamo Ururimi\"}', '2025-02-18 08:42:03', '2025-02-18 08:42:03'),
(2, 'Ministry of Health Client Satisfaction Feedback Tool', '{\"en\": \"Ministry of Health Client Satisfaction Feedback Tool\"}', '2025-02-18 08:42:03', '2025-03-14 09:02:14'),
(3, 'client_satisfaction_tool', '{\"ac\": \"Buk me yot tic pa jami\", \"at\": \"Aikujak lo epuroi aijarakin\", \"en\": \"Client Satisfaction Feedback Tool\", \"lg\": \"Ekitabo ky’okwekebejja okw’Abalwadde ku buweereza\", \"ls\": \"Ekitabo ky’okwekebejja okw’Abalwadde ku buweereza\", \"rk\": \"Ekitabo ky’okunyeterwa kw’abarwarwa ahabw’obusya\", \"rn\": \"Ekitabo ky’okunyeterwa kw’abarwarwa ahabw’obusya\"}', '2025-02-18 08:42:03', '2025-02-19 10:20:57'),
(4, 'subheading', '{\"ac\": \"Buk man mito bedo me jolo pa jami ikom tic ma obedo maber, tic me bedo iye ma iromo nywako, dok me bedo pe pa dano ikom jami me yot tic.\", \"at\": \"Aikujak lo epuroi itojariakin aijarakin, apunos itoloinakin epuroi, edic itoloiakin ajore ekisil aijarakin\", \"en\": \"This tool is used to obtain clients’ feedback about their experience with the services and promote quality improvement, accountability, and transparency within the healthcare system.\", \"lg\": \"Ekitabo kino kikozesebwa okutwala ebirowoozo by’abalwadde ku buweereza bwe bafunye n’okulwanyisa obulungi mu ngeri ya buweereza, obuvunaanyizibwa, n’obwenkanya mu ngeri y’ebyobulamu.\", \"ls\": \"Ekitabo kino kikozesebwa okutwala ebirowoozo by’abalwadde ku buweereza bwe bafunye n’okulwanyisa obulungi mu ngeri ya buweereza, obuvunaanyizibwa, n’obwenkanya mu ngeri y’ebyobulamu.\", \"rk\": \"Ekitabo eki nikikoreshwa kwetegereza abarwarwa ahabw’obusya bwe babahayo kandi kwongera omuganyuro, obugira omugasho, n’obugabe omu by\'obujanjabi.\", \"rn\": \"Ekitabo eki nikikoreshwa kwetegereza abarwarwa ahabw’obusya bwe babahayo kandi kwongera omuganyuro, obugira omugasho, n’obugabe omu by’obujanjabi.\"}', '2025-02-18 08:42:03', '2025-02-19 10:28:54'),
(5, 'client_demographics', '{\"en\": \"Client Demographics\", \"lg\": \"Ebyafaayo by\'Omulwadde\", \"rn\": \"Ebyafaayo By\'Omurwayi\"}', '2025-02-18 08:42:03', '2025-02-18 08:42:03'),
(6, 'region', '{\"ac\": \"District\", \"at\": \"Edodet\", \"en\": \"Region\", \"lg\": \"Ekitundu\", \"ls\": \"Ekitundu\", \"rk\": \"Ekitundu\", \"rn\": \"Ekitundu\"}', '2025-02-18 08:42:03', '2025-02-19 10:30:36'),
(7, 'district', '{\"ac\": \"District\", \"at\": \"Ekirinet\", \"en\": \"District\", \"lg\": \"Disitulikiti\", \"ls\": \"Disitulikiti\", \"rk\": \"Disitulikiti\", \"rn\": \"Disitulikiti\"}', '2025-02-18 08:42:03', '2025-02-19 10:31:12'),
(8, 'facility', '{\"ac\": \"Cit pa jami\", \"at\": \"Eteleunet aijarakin\", \"en\": \"Facility\", \"lg\": \"Ekifo ky’ebyobulamu\", \"ls\": \"Ekifo ky’ebyobulamu\", \"rk\": \"Eky’abajanjabi\", \"rn\": \"Eky’abajanjabi\"}', '2025-02-18 08:42:03', '2025-02-19 10:31:50'),
(9, 'health_facility_level', '{\"en\": \"Level of Health facility\", \"lg\": \"Omutindo gw\'Ekitongole ky\'ebyobulamu\", \"rn\": \"Omutindo gw\'Ekibanja ky\'ebyobulamu\"}', '2025-02-18 08:42:03', '2025-02-18 08:42:03'),
(10, 'ownership', '{\"ac\": \"Lobo pa jami\", \"at\": \"Itoloinakin\", \"en\": \"Ownership\", \"lg\": \"Obwannanyini\", \"ls\": \"Obwannanyini\", \"rk\": \"Obusingye bw’ekifo\", \"rn\": \"Obusingye bw’ekifo\"}', '2025-02-18 08:42:03', '2025-02-19 10:33:17'),
(11, 'reporting_period', '{\"en\": \"Present Day:\", \"lg\": \"Ekiseera ky\'okwolesa lipoota:\", \"rn\": \"Obwire bw\'okwolesa lipoota:\"}', '2025-02-18 08:42:03', '2025-04-09 07:17:04'),
(12, 'age', '{\"ac\": \"Oyot\", \"at\": \"Eido\", \"en\": \"Age\", \"lg\": \"Emyaaka\", \"ls\": \"Emyaaka\", \"rk\": \"Emyaaka\", \"rn\": \"Emyaaka\"}', '2025-02-18 08:42:03', '2025-02-19 10:34:12'),
(13, 'sex', '{\"ac\": \"Kit\", \"at\": \"Edwa\", \"en\": \"Sex\", \"lg\": \"Obusajja oba Obukazi\", \"ls\": \"Obusajja oba Obukazi\", \"rk\": \"Ekigume\", \"rn\": \"Ekigume\"}', '2025-02-18 08:42:03', '2025-02-19 10:34:47'),
(14, 'service_unit', '{\"ac\": \"Kany me tic\", \"at\": \"Ekinomakin\", \"en\": \"Service Unit\", \"lg\": \"Ekifo ekirimu obuweereza\", \"ls\": \"Ekifo ekirimu obuweereza\", \"rk\": \"Ekitongole eky’okugabura obujanjabi\", \"rn\": \"Ekitongole eky’okugabura obujanjabi\"}', '2025-02-18 08:42:03', '2025-02-19 10:35:22'),
(15, 'rating_instruction', '{\"ac\": \"Yweyo jami me tic bene kwo pi kit me lweny, kwede 1 ki 4.\", \"at\": \"Akame epuroi itoloinakin aijarakin, abinos 1 lo 4.\", \"en\": \"Please rate each of the following parameters according to your experience today on a scale of 1 to 4.\", \"lg\": \"Wekeneenye ebintu bino wansi ngokukozesa obusobozi bwo obuli leero, okuva ku 1 paka ku 4.\", \"ls\": \"Wekeneenye ebintu bino wansi ngokukozesa obusobozi bwo obuli leero, okuva ku 1 paka ku 4.\", \"rk\": \"Kebera ebintu ebiri wansi ngu ninga obusobozi bwo oburi leero, kuva 1 paka 4.\", \"rn\": \"Kebera ebintu ebiri wansi ngu ninga obusobozi bwo oburi leero, kuva 1 paka 4.\"}', '2025-02-18 08:42:03', '2025-02-19 10:36:20'),
(16, 'rating_scale', '{\"ac\": \"‘0’ bedo Marac, ‘1’ bedo Otyeno, ‘2’ bedo Ber, ‘3’ bedo Labongo.\", \"at\": \"‘0’ ikonikin apolit, ‘1’ ikonikin akipuran, ‘2’ ikonikin ejok, ‘3’ ikonikin edeje.\", \"en\": \"Where 0 means Poor, 1 Fair, 2 Good, and 3 Excellent.\", \"lg\": \"‘0’ kitegeeza Kibi, ‘1’ kitegeeza Kati kati, ‘2’ kitegeeza Kirungi, ‘3’ kitegeeza Kirungi nnyo.\", \"ls\": \"‘0’ kitegeeza Kibi, ‘1’ kitegeeza Kati kati, ‘2’ kitegeeza Kirungi, ‘3’ kitegeeza Kirungi nnyo.\", \"rk\": \"‘0’ nikitegeeza Kibi, ‘1’ nikitegeeza Mbwenu, ‘2’ nikitegeeza Kirungi, ‘3’ nikitegeeza Kinu.\", \"rn\": \"‘0’ nikitegeeza Kibi, ‘1’ nikitegeeza Mbwenu, ‘2’ nikitegeeza Kirungi, ‘3’ nikitegeeza Kinu.\"}', '2025-02-18 08:42:03', '2025-02-19 10:37:20'),
(17, 'submit', '{\"en\": \"Submit Feedback\", \"lg\": \"Weereza Ebirowoozo\", \"rn\": \"Weereza Ebirowoozo\"}', '2025-02-18 08:42:03', '2025-02-18 08:42:03');
